import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import * as API from '../services/api';
import TransactionList from '../components/TransactionList';

function EditPage() {
  const navigate = useNavigate();
  const [transactions, setTransactions] = useState([]);
  const [form, setForm] = useState({ description: '', amount: '', category: '' });
  const [error, setError] = useState('');
  const [defaultUser, setDefaultUser] = useState(null);

  // Load transactions for the given user
  const loadTransactions = () => {
    if (!defaultUser) return;
    API.getTransactions()
      .then(data => setTransactions(data || []))
      .catch(err => {
        console.error(err);
        setTransactions([]);
      });
  };

  // On mount, get default user and load their transactions
  useEffect(() => {
    API.getDefaultUser()
      .then(user => {
        setDefaultUser(user);
        loadTransactions();
      })
      .catch(err => {
        console.error(err);
        setTransactions([]);
      });
  }, []);

  // Submit new transaction
  const submit = () => {
    if (!defaultUser) return;

    const payload = {
      description: form.description,
      amount: parseFloat(form.amount),
      category: form.category,
      type: parseFloat(form.amount) >= 0 ? 'income' : 'expense',
      user: defaultUser._id
    };

    API.addtransaction(payload)
      .then(() => {
        setForm({ description: '', amount: '', category: '' });
        setError('');
        loadTransactions();
      })
      .catch(err => {
        console.error(err.response?.data || err);
        setError(err.response?.data?.error || 'Error adding transaction');
      });
  };

  // Delete a transaction
  const remove = (id) => {
    API.deleteTransaction(id)
      .then(() => loadTransactions())
      .catch(err => console.error(err.response?.data || err));
  };

  return (
    <div style={{ padding: 20 }}>
      {/* Header and Back Button */}
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 30 }}>
        <button onClick={() => navigate('/')} style={{ padding: '6px 12px' }}>Back</button>
        <h1 style={{ textAlign: 'center', flex: 1 }}>Edit Transactions</h1>
      </div>

      {/* Add Transaction Form */}
      <div style={{ marginBottom: 60, textAlign: 'center' }}>
        <h3>Add Transaction</h3>
        {error && <div style={{ color: 'red', marginBottom: 8 }}>{error}</div>}

        <div style={{ display: 'flex', justifyContent: 'center', gap: '12px', flexWrap: 'wrap' }}>
          <input
            placeholder="Description"
            value={form.description}
            onChange={(e) => setForm({ ...form, description: e.target.value })}
            style={{ padding: '6px 10px', minWidth: 150, flex: 1 }}
          />
          <input
            placeholder="Amount"
            type="number"
            value={form.amount}
            onChange={(e) => setForm({ ...form, amount: e.target.value })}
            style={{ padding: '6px 10px', minWidth: 100, flex: 1 }}
          />
          <input
            placeholder="Category"
            value={form.category}
            onChange={(e) => setForm({ ...form, category: e.target.value })}
            style={{ padding: '6px 10px', minWidth: 120, flex: 1 }}
          />
          <button onClick={submit} style={{ padding: '6px 14px' }}>Add</button>
        </div>
      </div>

      {/* Existing Transactions */}
      <h3 style={{ marginBottom: 20 }}>Existing Transactions</h3>
      <TransactionList transactions={transactions} remove={remove} />
    </div>
  );
}

export default EditPage;
